import React from "react";
import { Wrapper, Row, Col, Nav } from "react-bootstrap";
import InvNavBut from "../../components/Invoice/InvNavBut";
import JobNavBut from "../../components/JobEntry/JobNavBut";

class LandingPage extends React.Component {
    render() {
        return (
            <div>
                <Nav variant="pills" defaultActiveKey="/home">
                    <Nav.Item>
                        <Nav.Link href="/home"><JobNavBut /></Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link eventKey="link-1"><InvNavBut /></Nav.Link>
                    </Nav.Item>
                </Nav>

                {/* <h1>Top Notch Plumbing</h1>
                    <p>Get started by clicking one of the buttons below.
                        </p>
                        <Wrapper id= "button-holder">
                        <Row>
                            <Col> </Col>
                            <Col xs={6}><JobNavBut /></Col>
                            <Col></Col>
                        </Row>
                        <Row></Row>
                        <Row>
                            <Col></Col>
                            <Col xs={6}><InvNavBut /></Col>
                            <Col></Col>
                        </Row>
                        </Wrapper> */}
            </div>
        );
    }
}

export default LandingPage;
